import React from "react";
import "./App.css";
import Header from "./components/Header";

const Body: React.FC = () => {
  function counter() {
    return <h1>hello</h1>;
  }
  return (
    <>
      <form>
        <table>
          <tr>
            <td>Restaurant name:</td>
            <td>
            <input
              id="searchName"
              className="searchName"
              type="text"
              name="restaurant"
            />
            </td>
          </tr>
          <tr>
            <td>Review:</td>
            <td><textarea name="comment"></textarea></td>
          </tr>
          <tr>
            <td>Ranting</td>
            <td>          
              <input
              type="number"
              id="points"
              name="points"
              step="1"
            /></td>
          </tr>
          <tr>
            <td>          <button type="submit" value="Submit">
              Save
            </button></td>
            <td><button type="reset" value="Reset">
              Cancel
            </button></td>
            <td><button>Delete</button></td>
          </tr>
        </table>
      </form>
    </>
  );
};

const App: React.FC = () => {
  return (
    <div className="body">
      <Header />
      <Body />
    </div>
  );
};

export default App;
